-- ----------------------------
-- Table structure for `td_goods`
-- ----------------------------
DROP TABLE IF EXISTS `td_goods`;
CREATE TABLE `td_goods` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '商品ID',
  `goods_no` varchar(50) DEFAULT NULL COMMENT '商品的货号',
  `goods_name` char(200) NOT NULL COMMENT '商品名称',
  `store_nums` int(10) unsigned NOT NULL DEFAULT '1' COMMENT '库存',
  `sell_price` double(9,2) NOT NULL DEFAULT '0.00' COMMENT '销售价格',
  `market_price` decimal(9,2) NOT NULL DEFAULT '0.00' COMMENT '市场价格',
  `cost_price` decimal(9,2) NOT NULL DEFAULT '0.00' COMMENT '成本价格',
  `weight` decimal(9,2) NOT NULL DEFAULT '0.00' COMMENT '重量',
  `up_time` int(10) DEFAULT NULL COMMENT '上架时间',
  `down_time` int(10) DEFAULT NULL COMMENT '下架时间',
  `sale` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '销量',
  `brand_id` int(10) unsigned DEFAULT NULL COMMENT '品牌ID',
  `files_id` int(10) DEFAULT NULL COMMENT '主图封面files表id',
  `index_img` int(10) unsigned DEFAULT NULL COMMENT '首页图片Id',
  `list_img` int(10) unsigned DEFAULT NULL COMMENT '列表页长方形展示图片',
  `city_id` int(10) unsigned DEFAULT NULL COMMENT '地点，与pro_city表id关联',
  `seller_id` int(10) NOT NULL DEFAULT '0' COMMENT '商家id',
  `search_words` varchar(50) DEFAULT NULL COMMENT '产品搜索词库,逗号分隔',
  `spec_array` text COMMENT 'json规格数据',
  `spec_title` text COMMENT 'json规格titles',
  `sc_sort` char(225) DEFAULT NULL COMMENT '规格排序',
  `create_time` int(10) DEFAULT NULL COMMENT '创建时间',
  `is_new` tinyint(1) DEFAULT '0' COMMENT '新品首发',
  `is_special` tinyint(1) DEFAULT '0' COMMENT '特价商品',
  `is_hot` tinyint(1) DEFAULT '0' COMMENT '热卖商品',
  `is_best` tinyint(1) DEFAULT '0' COMMENT '精品推荐',
  `is_discount` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否启用会员组折扣，1:是，0:否',
  `is_top` int(10) DEFAULT '99' COMMENT '是否置顶 存置顶时间戳',
  `series_name` varchar(50) DEFAULT NULL COMMENT '产品所属系列',
  `sort` int(10) NOT NULL DEFAULT '99' COMMENT '排序',
  `state` tinyint(1) NOT NULL DEFAULT '0' COMMENT '商品状态：0待上架 1上架(正常） 2下架 3删除',
  `seo_keywords` char(255) DEFAULT NULL COMMENT 'SEO关键词',
  `seo_description` text COMMENT 'SEO描述',
  `integral` int(6) DEFAULT '-1' COMMENT '分销积分',
  `commission_ratio` int(2) unsigned NOT NULL DEFAULT '0' COMMENT '佣金比率',
  `bad_comment` int(6) unsigned NOT NULL DEFAULT '0' COMMENT '商品评价：差评数',
  `mid_comment` int(6) unsigned NOT NULL DEFAULT '0' COMMENT '商品评价：中评数',
  `good_comment` int(6) unsigned NOT NULL DEFAULT '0' COMMENT '商品评价：好评数',
  `members_price` text COMMENT '会员组价格[如果is_discount=1则读取该字段]',
  `is_share` tinyint(1) unsigned DEFAULT '0' COMMENT '是否共享商品，0不共享，1共享',
  PRIMARY KEY (`id`),
  KEY `fk_td_goods_td_brand1_idx` (`brand_id`)
) ENGINE=InnoDB AUTO_INCREMENT=132 DEFAULT CHARSET=utf8 COMMENT='产品表';

